a:260:{i:0;a:1:{s:2:"id";s:19:"2391128319222722806";}i:1;a:1:{s:10:"short_code";s:11:"CEu_omfpbD2";}i:2;a:1:{s:12:"created_time";i:1599264729;}i:3;a:1:{s:7:"caption";s:1374:"I would like to dedicate this image to each and every one of my teacher friends including my beautiful wife (who's the apple of my eye). This is M27, the Apple Core Nebula (or officially Dumbbell Nebula). Thank you for all your dedication and hard work in this unprecedented time in our history with the pandemic.  Thank you for teaching these students how to be responsible human beings and keeping everyone safe! 

M27 is a planetary nebula, created when dying stars shed their outer layers of gases as its core shrinks.  It's actually a misnomer, containing no planets.  The gas cloud surrounding a central dying star is thought of as a "planetary" blanket, thus its name.  The light's color is still based on the major element, in this case, lots of oxygen (O-III) was in the area and created this nice blue-green halo.  M27 is located in Vulpecula, the "little fox" 1300 light-years away.  Through your telescopes, it appears to be white, but through  photography, its radiant colors come to life.

